import React, { useState } from 'react';
import { ubuntuIP } from '../../Components/constantVariable';
import './parseData.css'; // Import your CSS file for styling

const ParseData = ({ rowData, onClose }) => {
  const [formData, setFormData] = useState(rowData.s_raw_pkt);
  const [fetchedData, setFetchedData] = useState([]);

  const handleSubmit = (e) => {
    e.preventDefault();
    const queryString = `?s_raw_pkt=${formData}`;
    fetch(`${ubuntuIP}/api/v0/getParsedData${queryString}`, {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json'
      }
    })
      .then(response => response.json())
      .then(data => {
        console.log("form DATA", formData);
        setFetchedData(data.data);
        alert('Data fetched successfully!')
      })
      .catch(error => {
        console.error('Error:', error);
        alert('Error! Please try again.');
      });
  };

  return (
    <div className="modal">
      <div className="modal-content">
        <input type="text" value={formData} onChange={(e) => setFormData(e.target.value)} />
        <button onClick={handleSubmit}>Submit</button>
        {fetchedData.length > 0 && (
          <div>
            <h2>Fetched Details:</h2>
            {fetchedData.map((detail, index) => (
              <div key={index} className="data-row">
                {Object.keys(detail).reduce((chunks, key, index) => {
                  const chunkIndex = Math.floor(index / 3);
                  if (!chunks[chunkIndex]) {
                    chunks[chunkIndex] = [];
                  }
                  chunks[chunkIndex].push({ key, value: detail[key] });
                  return chunks;
                }, []).map((chunk, index) => (
                  <div key={index} className="row">
                    {chunk.map(({ key, value }, index) => (
                      <p key={index}><strong>{key}:</strong> {value}</p>
                    ))}
                  </div>
                ))}
                <hr />
              </div>
            ))}
          </div>
        )}
        <button onClick={onClose}>Close</button>
      </div>
    </div>
  );
};

export default ParseData;
